@oflynnsocial 1. Walk Southbank to Tower of London via stops at Tate Modern, Globe &amp;  Tower Bridge.  Great day.
2. Morning at Kew Gardens, afternoon in Richmond.
3. Spiltalfields Sunday morning. Food stands never disappoint. Round the corner to Brick Lane for more shopping &amp; food.

@skydavidblevins @GWalker9 Absolutely. As an old warhorse, I'm often asked by students about a media career. Most important bits of advice: 1. If you're not genuinely curious, don't do it. 
2. If it's fame you want, apply to Love Island.
3. Invest in warm coats &amp; thick-soled shoes with thermal insoles!

